libs.content:
find_library(sdl2_library_temp
  names sdl2
  hints
  $env{sdl2dir}
  path_suffixes lib64 lib
  paths ${sdl2_search_paths}
)

find_library(sdl2main_library
      names sdl2main
      hints
      $env{sdl2dir}
      path_suffixes lib64 lib
      paths ${sdl2_search_paths}
    )

find_library(vorbis_library
	names
		vorbis
		vorbis_static
		libvorbis
		libvorbis_static
	hints
		${pc_vorbis_libdir}
		${pc_vorbis_library_dirs}
		${vorbis_root}
	)

find_library(vorbisfile_library
	names
		vorbisfile
		vorbisfile_static
		libvorbisfile
		libvorbisfile_static
	hints
		${pc_vorbisfile_libdir}
		${pc_vorbisfile_library_dirs}
		${vorbisfile_root}
	)

find_library(ogg_library
	names
		ogg
		ogg_static
		libogg
		libogg_static
	hints
		${pc_ogg_libdir}
		${pc_ogg_library_dirs}
		${ogg_root}
	)
